NO CONTEST plea entered to count 3, bail jumping.  Convicted.
The State moves to dismiss and read in counts 1 and 2.  Motion granted.
Sentence is withheld and the defendant is placed on probation to DOC for twelve (12) months.
Conditions of probation:
1) AODA assessment and follow through;
2) Submit to random urine screens and pay for same;
3) Maintain fulltime employment or schooling;
4) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
5) Pay court costs of $443.00.  $50.00 cash bail applied;
6) pay supervision fees in an amount to be determined by DOC;
7) provide DNA sample;
8) defendant is to use one doctor to prescribe medications and one pharmacist to dispense medications unless approved by the agent.
Minutes.
